import React from "react";

const MovieList = ({ movies }) => {
  const handlePosterClick = (youtubeLink) => {
    // Redirect the user to watch the movie on YouTube
    window.open(youtubeLink, "_blank");
  };

  return (
    <div className="movieList">
      {movies.map((movie) => (
        <div className="movie" key={movie.id}>
          <img
            src={require(`${movie.imageUrl}`).default}
            alt={movie.title}
            onClick={() => handlePosterClick(movie.youtube)}
            style={{ cursor: "pointer" }}
          />
          <p>{movie.title}</p>
        </div>
      ))}
    </div>
  );
};

export default MovieList;
